import React from 'react';
import './AboutMe.css'; // Add this for styling
import profilePhoto from './image/ji.jpg'; // Replace with your photo path

function AboutMe() {
  return (
    <section id="about">
      <h2>About Me</h2>
      <div className="about-content">
        <div className="profile-picture">
          <img src={profilePhoto} alt="Profile" />
        </div>
        <div className="about-description">   
          <p>
            Halo nama saya Ahmad Alfarizzi saya adalah seorang siswa di SMK ANTARTIKA 2 SIDOARJO jurusan Teknik Komputer Jaringan. Saya memiliki ketertarikan dalam dunia teknologi dan ingin menjadi seorang web developer,Saya memiliki pengalaman dalam membuat aplikasi web menggunakan React dan Node.js. Saya juga memiliki pengalaman dalam membuat aplikasi web CRUD database menggunakan php. Saya memiliki kemampuan dalam membuat aplikasi berbasis web yang interaktif dan responsif.<a href="/image/cv.jpg" download="cv" >
  <img src="/image/cv.jpg" alt=""/>
</a>
          </p>
        </div>
      </div>
    </section>
  );
}

export default AboutMe;
